        <h1>Download our free “Altosid®&nbsp;Liquid Larvicide Efficacy Sheet”</h1>
        <p>Altosid<sup>®</sup> Liquid Larvicide has a proven history of effectively controlling disease-carrying mosquitoes. Download our free “Altosid<sup>®</sup> Liquid Larvicide Efficacy Sheet” to learn more about how this unique mode of action prevents the emergence of adult mosquitoes, and view detailed results of product trials including a Florida study that achieved 98 percent control of <em>Ae. aegypti</em> and <em>albopictus</em> larvae in backyard containers.</p>
        <br />
